import React from 'react'
import axios from 'axios'


function Fetch({setPersons}) {
	useEffect(() => {
		axios
			.get("http://localhost:3001/persons")
			.then(response => {
				console.log(response.data)
				setPersons(response.data)
			})
	}, [])
	return (
		<div>

		</div>
	)
}

export default Fetch
